const Actor = () => (
    <StyledActor>
        <img
            src={
                Actor.profile_path
                ? `${IMAGE_BASE_URL}${POSTER_SIZE}${actor.profile_path}`
                : NoImage
            }
            />
    </StyledActor>
)

export default Actor;
